import './App.css';
import { BrowserRouter, Route, Router } from 'react-router-dom';
import Landing from './components/Landing/Landing';
import Home from './components/home/home';

function App() {
  return (
    <div className="App">
       <Router>
          <Route  path="/" element={Landing} />
          <Route  path="/Home" element={Home}/>
      </Router> 
    </div>
  );
}

export default App;
